    false,nt"url": null,nt"notes": "The Refuge engages in active habitat management
    for CWTD, including pasture enhancement, grazing, tree planting, and invasive species
    management.  While we assume that this habitat manipulation is positive for deer,
    we have no objective measure of use for these habitats, and we may have to wait
    years to note a sustainable effect on population numbers.  By placing GPS collars
    on deer, we can track habitat use and home range of deer.  More importantly we can
    assess changes in habitat use in relation to management activities. This will inform
    management and allow us to alter habitat in a way that optimizes deer utilization.",nt"owner_org":
